import React, { Component } from 'react';
import logo from './logo.svg';
import instagram from './instagram.png';
import youtube from './youtube.png';
import google from './google.png';
import './App.css';


class App extends Component {
  render() {
    const instagram = 'https://www.instagram.com/'
    const google = 'https://www.google.com/'
    const youtube = 'https://www.youtube.com/'
    return (
        <header className="App-header">
          <div className="App">
            <h1> Welcom Alham Febian Rinaldy!</h1>
            <img src={logo} className="App-logo" alt="logo" />
            <h3> What do you like to do? </h3>

            <div className="instagram">
              <img src={instagram} className="instagram-logo" alt="logo" />
              <a href={instagram}> See your friends on Instagram? </a>
            </div>

            <div className="goggle">
              <img src={google} className="google-logo" alt="logo" />
              <a href={google}> Search something you like? </a>
            </div>

            <div className="instagram">
              <img src={youtube} className="youtube-logo" alt="logo" />
              <a href={youtube}> Watch some videos? </a>
            </div>



          </div>
        </header>
    );
  }
}

export default App;
